import 'antd/dist/antd.css';
import CustomLayout from './containers/Layout';
import React, {Component} from 'react'
import BaseRoute from './routes'
import { BrowserRouter as Router } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Router>
        <CustomLayout>
          <BaseRoute></BaseRoute>
        </CustomLayout>
      </Router>

    </div>
  );
}

export default App;
